import React from 'react';
import { View, Text, Image, StyleSheet } from 'react-native';

const Profile = () => {
    return (
      <View style={styles.container}> 
        <View style={styles.item}> 
                <View style={{flex: 1, alignContent: "center"}}> 
                    <Image source={require('../assets/images/profile1.png')} style={{ width: 52,resizeMode: 'center', height: 52 }}/>
                </View> 
                <View style={{flex: 2, alignItems: 'flex-start'}}>
                    <Text style={styles.title}>ABC CARGO</Text>  
                      <Text style={styles.text}>Facility ID:NYC001</Text>
                </View>
                <View style={{flex: 1 ,flexDirection: "column" }}>
                    <View style={styles.itemCount}>
                      <Text style={styles.title}>2127</Text>
                      <Image source={require('../assets/images/Package.png')} style={{ width: 28,resizeMode: 'center', height: 27, marginBottom: 10 }}/> 
                    </View> 
                    <View style={styles.itemCount}>
                      <Text style={styles.text}>213</Text>
                      <Image source={require('../assets/images/cashImg.png')} style={{ width: 28,resizeMode: 'center', height: 20}}/> 
                    </View> 
                </View>
            </View> 
      </View>
    );
};

export default Profile;

const styles = StyleSheet.create({
  container: {
    flex: 1, 
    padding : "3%"  
  },
  text:{ 
    fontSize: 12, 
    textTransform: 'capitalize',
    flex: 1,
  },
  title: { 
    color: "#185354",
    fontSize: 16,
    fontFamily: "UbuntuMedium", 
    textTransform: 'uppercase',
    paddingVertical: "3%"
  }, 
  itemCount : {
    flex: 1,
    flexDirection: "row",
    justifyContent: 'space-between', 
  },
  item: { 
    flexDirection: 'row',
    color: "#185354",
    fontSize: 14, 
    paddingHorizontal: "5%",
    paddingVertical: "5%",
    marginTop: "3%",
  }
});
